The Usva River (Russian: Усьва) is a river in Perm Krai in Russia, a right tributary of the Chusovaya River (Kama's basin). The river is 266 kilometres (165 mi) long, and its drainage basin covers 6,170 square kilometres (2,380 sq mi). The Usva freezes up in November and remains icebound until late April or early May. This is a lowland river for most of its course except upstream, where it has many rocks and rapids. Its banks are steep and rocky, covered with forests.The Usva crosses the Basegi range, which reaches 951 metres (3,120 ft) in elevation at North Baseg. There are seven localities on the banks of the river and some abandoned villages. The town of Chusovoy is at the confluence of the Usva and the Chusovaya rivers. Main tributaries: 
* Left: Vilva, Bolshaya Hariusnaya, Malaya Hariusnaya, Porozhnaya; 
* Right: Suriya, Berezovka, Persha, Tulumovka.

Uls (Russian: Улс) is a river in Perm Krai, Russia, a left tributary of the Vishera River. The river is 89 kilometres (55 mi) long, and its drainage basin is 2,190 square kilometres (850 sq mi). It starts near the border with Sverdlovsk Oblast. Its mouth is near the village of Ust-Uls, 233 kilometres (145 mi) from Vishera's mouth. Main tributaries: 
* Left: Olkhovka River, Pelya River, Bolshaya Zolotanka River; 
* Right: Surya River, Bolshaya Lyampa, Kutim River, Myka River .
